const background_color = '#ECE5D8';
const box_color = '#D9CCC1';
const accent_color = '#D7B16C';

const rabbitTheme = {
  dark: false,
  colors: {
    background: background_color,
    border: 'transparent'
  },
}

export default rabbitTheme;
